import React from 'react';
import { 
    IonButton,
    IonButtons,
    IonIcon
} from '@ionic/react';
import { returnUpBack } from 'ionicons/icons';
var defaultHref = '"/home"';

const goBack = () => {


}

const BackBtn: React.FC = () => {
    return (
        <IonButtons slot="end">
            <IonButton onClick={goBack} href={defaultHref}>
                <IonIcon slot="icon-only" icon={returnUpBack}></IonIcon>
            </IonButton>
        </IonButtons>
    )
}

export default BackBtn;
